// src/components/DataPreparation.js
import React from 'react';
import { Link } from 'react-router-dom';

const DataPreparation = () => {
  return (
    <div>
      <p>Click <Link to="/input">here</Link> to start query.</p>
    </div>
  );
};

export default DataPreparation;
